import Bord from './Bord';

function CardCreateContainer(props) {

  const style = {
    width: "350px",
    height: "900px",
    background: "darkgray"
  };

  return (
    <div className="cardCreateContainer" style={style}>
      <h4>タイトル</h4>
      <h4>概要</h4>
    </div>
  );
}

export default CardCreateContainer;
